INSERT INTO `posts` VALUES (1,'Apna College','https://youtu.be/eKqY-oP1d_Y','How to Start Coding? Learn Programming for Beginners','2023-04-11','1'),(3,'David Bombal','https://youtu.be/-OAa9k0zCDg','What are you going to do in 2023? Tops 5 skills to get!','2023-04-11','1'),(4,'What is RFID?','0','Radio Frequency Identification (RFID) refers to a wireless system comprised of two components: tags and readers. The reader is a device that has one or more antennas that emit radio waves and receive signals back from the RFID tag.','2023-04-11','1'),(12,'Pomodoro vs Flowtime','0','The difference between The Pomodoro Technique and The Flowtime Technique is that the Pomodoro has a predetermined time limit for how long you work (25 minutes), with defined short and long breaks in between. On the other hand, The Flowtime Technique allows you to choose one task and focus on it for an extended period of time and only take pauses as needed to maintain your “flow”.','2023-04-10','2'),(13,'linux tech tips','https://www.youtube.com/watch?v=nLIp4wd0oXs','check this out!','2023-04-11','2');
